import React from "react";
import "./Checkout.scss";

const CheckoutPage = () => {
  return (
    <div className="CheckoutPage">
      <div className="checkout-headers">
        <h3>Product</h3>
        <h3>Description</h3>
        <h3>Quantity</h3>
        <h3>Price</h3>
        <h3>Remove</h3>
      </div>
    </div>
  );
};

export default CheckoutPage;
